(39, 840, '非常好', 1572245349),
(40, 816, '还不错  挺棒的  知道好多(✪▽✪)', 1572252342),
(41, 906, '谢谢提醒', 1572592966),
(42, 915, '有了小核桃的温馨提示，掌握了许多，关于宝宝成长过程中的事项，非常适合这些宝宝爸爸妈妈爷爷奶奶们的学习！不错过宝宝发育成长的每个时间！继续关注！感谢小核桃APP的温馨提醒！', 1575257764),
(43, 552, '今天听了一条关于不让宝宝穿开裆裤，要穿纸尿裤的。但是一岁半宝宝开始要学习大小便了。一直穿纸尿裤的小朋友现在很多到三岁还在穿纸尿裤，而且不穿纸尿裤他们会觉得不习惯，关于这点，请添加纸尿裤的使用时段', 1576625820),
(44, 1057, '语音内容与年龄不匹配，适合头胎妈妈学习和盼望孩子未来的成长', 1577267880),
(45, 1158, '1、添加宝宝照片\n2、可以宝宝的出生日期\n3、添加多个宝宝\n4、每日语音，可以加上文字', 1578441529);
